import React from 'react'

const Ownitem = ({ownPost}) => {
    return (
        <div className="col-12 m-4 post-box">
           <p>{ownPost.post_title}</p>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;
           <small style={{color:'#ccc'}}>{ownPost.post_discription}</small>
        </div>
    )
}

export default Ownitem
